package utilisateurs.gestionnaires;

import java.util.Collection;
import javax.ejb.Stateless;
import javax.persistence.EntityManager;
import javax.persistence.PersistenceContext;
import javax.persistence.Query;
import utilisateurs.modeles.Tshirt;

/**
 *
 * @author Aicha
 */
@Stateless
public class GestionnaireTshirt {

    @PersistenceContext
    private EntityManager em;

    public Tshirt creerTshirt(String miage, String pays, byte[] photo) {
        Tshirt t = new Tshirt(miage, pays, photo);
        em.persist(t);
        return t;

    }

    public void creerTshirtconcour() {
        String photo = "data:image/png;base64,";

        creerTshirt("Nice", "Chine", photo.getBytes());
        creerTshirt("Aix-Marseille", "Italie", photo.getBytes());
        creerTshirt("Amiens", "Etats-Unis", photo.getBytes());
        creerTshirt("Bordeaux", "Brésil", photo.getBytes());
        creerTshirt("Grenoble", "Allemagne", photo.getBytes());
        creerTshirt("Guadeloupe", "Espagne", photo.getBytes());
        creerTshirt("Lille", "Suisse", photo.getBytes());
        creerTshirt("Mulhouse", "Le monde entier", photo.getBytes());
        creerTshirt("Nancy", "Russie", photo.getBytes());
        creerTshirt("Nantes", "République Tchéque", photo.getBytes());

    }
   

    public Collection<Tshirt> getTshirtConcour() {
        // Exécution d'une requête équivalente à un select *  
        Query q = em.createQuery("select t from Tshirt t");
        Collection<Tshirt> tshirts = q.getResultList();
        for (Tshirt t : tshirts) {
            t.setUrlphoto(new String(t.getPhoto()));
        }
        return tshirts;
    }
}
